import React, {Component} from 'react';

class App extends Component {
    state = {
        todos: [
            {
                todo: 'clean',
                id: 1,
                complete: false
            },

        ]
    }


    render() {
        return (
            <div>
                {this.state.todos.map((todo => (
                    <p>{todo.name}</p>
                )))}
            </div>
        );
    }
}

export default App;
